import React, { useState } from 'react';
import styled from 'styled-components';

const PageWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 40px;
  min-height: 100vh;
  background: linear-gradient(135deg, #e9e4e0 0%, #f3ece8 100%);
  font-family: 'Raleway', sans-serif;
`;

const Form = styled.form`
  width: 100%;
  max-width: 500px;
  padding: 30px;
  border-radius: 15px;
  background: #fff;
  box-shadow: 0px 8px 16px rgba(0, 0, 0, 0.1);
  border: 1px solid rgba(200, 200, 200, 0.3);
`;

const Title = styled.h2`
  text-align: center;
  margin-bottom: 30px;
  font-family: 'EB Garamond', serif;
  color: #333;
  font-size: 26px;
  font-weight: bold;
`;

const FormGroup = styled.div`
  margin-bottom: 25px;
  display: flex;
  flex-direction: column;
  position: relative;
`;

const Label = styled.label`
  font-size: 16px;
  color: #333;
  font-weight: 600;
  margin-bottom: 5px;
`;

const Input = styled.input`
  padding: 12px 15px;
  border-radius: 8px;
  border: 1px solid ${({ isError }) => (isError ? '#e74c3c' : 'rgba(0, 0, 0, 0.2)')};
  font-size: 16px;
  background-color: #fefefe;
  font-family: 'Raleway', sans-serif;
  transition: border-color 0.3s, box-shadow 0.3s;
  box-sizing: border-box;

  &:focus {
    border-color: #5b9e5d;
    box-shadow: 0px 0px 8px rgba(92, 158, 93, 0.3);
    outline: none;
  }
`;

const SubmitButton = styled.button`
  border-radius: 12px;
  padding: 10px 16px;
  font-size: 16px;
  cursor: pointer;
  color: #ffffff;
  border: none;
  background-color: #8b5e3c;
  transition: background-color 0.3s, transform 0.2s;
  width: 100%;
  box-sizing: border-box;

  &:hover {
    transform: translateY(-3px);
    background-color: #70462c;
  }
`;

const ErrorText = styled.span`
  color: #e74c3c;
  font-size: 14px;
  margin-top: 4px;
  height: 18px;
  visibility: ${({ isVisible }) => (isVisible ? 'visible' : 'hidden')};
`;

const LoginPage = ({ setIsLoggedIn }) => {
  const [formData, setFormData] = useState({
    username: '',
    password: '',
  });
  const [errors, setErrors] = useState({});
  const [apiErrorMessage, setApiErrorMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const validate = () => {
    const inputErrors = {};
    if (!formData.username) {
      inputErrors.username = 'Username is required.';
    }
    if (!formData.password) {
      inputErrors.password = 'Password is required.';
    }
    return inputErrors;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const inputErrors = validate();
    if (Object.keys(inputErrors).length === 0) {
      // Simulate login process here
      setIsLoggedIn(true);
      setApiErrorMessage('');
    } else {
      setErrors(inputErrors);
    }
  };

  return (
    <PageWrapper>
      <Form onSubmit={handleSubmit}>
        <Title>Login to Your Account</Title>
        <FormGroup>
          <Label htmlFor="username">Username</Label>
          <Input
            type="text"
            id="username"
            name="username"
            placeholder="Enter your username"
            value={formData.username}
            onChange={handleChange}
            isError={!!errors.username}
          />
          <ErrorText isVisible={!!errors.username}>{errors.username}</ErrorText>
        </FormGroup>
        <FormGroup>
          <Label htmlFor="password">Password</Label>
          <Input
            type="password"
            id="password"
            name="password"
            placeholder="Enter your password"
            value={formData.password}
            onChange={handleChange}
            isError={!!errors.password}
          />
          <ErrorText isVisible={!!errors.password}>{errors.password}</ErrorText>
        </FormGroup>
        {apiErrorMessage && <ErrorText isVisible>{apiErrorMessage}</ErrorText>}
        <SubmitButton type="submit">Login</SubmitButton>
      </Form>
    </PageWrapper>
  );
};

export default LoginPage;
